	public function clearAllReferences($deep = false)
	{
		if ($deep) {
			if ($this->collItinerarys) {
				foreach ((array) $this->collItinerarys as $o) {
					$o->clearAllReferences($deep);
				}
			}
			if ($this->collMissions) {
